import React from 'react';
import styled from 'styled-components'

const StyledUserTag = styled.div`
  background-color: #34495e;
  border-radius: 8px;
  width: 50%;
  padding: 5px;
  margin: 2px;
  border-top: 2px solid white;
`

const UserTag = props => {
  return(
    <StyledUserTag>
      {props.name}
    </StyledUserTag>
  )
}

export default UserTag;
